import React from "react";
import { Header, Client, Feature } from "parts/Part";
import { Section } from "elements/Element";
import Fade from "react-reveal/Fade";
import MidlewareProps from "../PropsType";

import HeroImage from "assets/images/hero-image.png";
import FeatureTitle01 from "assets/images/feature-title-icon-01.svg";
import FeatureTitle02 from "assets/images/feature-title-icon-02.svg";
import FeatureTitle03 from "assets/images/feature-title-icon-03.svg";
import FeatureTitle04 from "assets/images/feature-title-icon-04.svg";
let dataFeature = [
  {
    imgSrc: FeatureTitle01,
    imgAlt: "Feature icon title 01",
    title: "join 01",
  },
];
MidlewareProps({ Section });
export default function Homepage() {
  return (
    <div className="body-wrap">
      <Header></Header>
      <main className="site-content">
        <Section className="hero  illustration-section-01" isCenterContent>
          <div className="container-sm">
            <div className="hero-inner section-inner">
              <div className="hero-content">
                <Fade bottom delay={1500}>
                  <h1 className="mt-0 mb-16 ">Landing template for startups</h1>
                </Fade>
                <div className="container-xs">
                  <Fade bottom delay={2000}>
                    <p className="mt-0 mb-32 ">
                      Our landing page template works on all devices, so you
                      only have to set it up once, and get beautiful results
                      forever.
                    </p>
                  </Fade>
                </div>
              </div>
              <div
                className="hero-figure  illustration-element-01"
                data-reveal-value="20px"
                data-reveal-delay="800"
              >
                <Fade bottom delay={2500}>
                  <img
                    className="has-shadow"
                    src={HeroImage}
                    alt="Hero"
                    width="896"
                    height="504"
                  />
                </Fade>
              </div>
            </div>
          </div>
        </Section>
        <Client></Client>
        <Section className="features-tiles section">
          <div class="container">
            <div class="features-tiles-inner section-inner">
              <div class="tiles-wrap">
                <Feature
                  delayInMs={2500}
                  data={{ imgSrc: "", imgAlt: "", title: "", description: "" }}
                ></Feature>
              </div>
            </div>
          </div>
        </Section>
      </main>
    </div>
  );
}
